import React from "react";
import "./App.css";
import Navbar from "./Navbar";
import Information from "./Information";
import Footer from "./Footer";

function App() {
  return (
    <div className="app">
      <Navbar />
      <Information />
      <Footer />
    </div>
  );
}

export default App;
